import styled from "styled-components"

const Page = () => {
    return <PageWrapper>
            <LoginWrapper>
                <Title>Login</Title>
            </LoginWrapper>
        </PageWrapper>
}

export default Page;



const Title = styled.h1`    
    font-weight: 100;
    letter-spacing: 0.1em;
`

const PageWrapper = styled.div`
    display: flex;
    justify-content: center;
`

const LoginWrapper = styled.div`
    box-shadow: inset 10px -10px 40px 1px teal;;
    padding: 1em;
    display: flex;
    justify-content: center;
    border-radius: 5px;
    margin-top: 4em;
    border: 1px solid white;
    width: 40em;
    height: 40em;
`
